                <th className="px-2 py-4"> Proof Of Identity Expir Date</th>
                <th className="px-2 py-4"> Dependent Relationship Type</th>
                <th className="px-2 py-4"> Birth Certificate</th>
                <th className="px-2 py-4"> Birth Certificate Issuer</th>
                <th className="px-2 py-4"> Action </th>
              </thead>
              <tbody>
                {holdSoleDependent.map((soleDependent, index) => (
                  <tr>
                    {/* <td>{soleDependent.Id}</td> */}
