                      {soleDependent.FirstName} {soleDependent.MiddleName}{" "}
                      {soleDependent.LastName}
                    </td>
                    <td>{soleDependent.Nationality}</td>
                    <td>{soleDependent.CountryOfOrigin}</td>
                    <td>{soleDependent.CountryOfResidence}</td>
                    <td>{soleDependent.ProofOfIdentityType}</td>
                    {/* <td>{soleDependent.ProofOfIdentityFile}</td> */}
                    <td>{soleDependent.ProofOfIdentityIssueDate}</td>
                    <td>{soleDependent.ProofOfIdentityExpirDate}</td>
                    <td>{soleDependent.DependentRelationshipType}</td>
                    <td>{soleDependent.BirthCertificate}</td>
                    <td>{soleDependent.BirthCertificateIssuer}</td>
                    <td>
                      <button
                        onClick={() => {
                          handleCompanySoleDependentEditedModalOpen();
                          getDependentById(soleDependent.Id);
                          setDependentId(soleDependent.Id);
                        }}
