                        delete
                      </button>
                    </td>
                  </tr>
                ))}
              </tbody>
            </table>
          ) : (
            ""
          )}
          <button
            onClick={() => setToggleSoleDependent(!toggleSoleDependent)}
            className="text-purple-600 rounded-md font-medium "
          >
            Add Married
          </button>
          {toggleSoleDependent && (
            <div className="submit-form">
              {submitted ? (
                <div>
                  <h4>You submitted successfully!</h4>
                </div>
              ) : (
                <div className="relative center justify-center flex-1 w-full max-w-full grid grid-cols-1 sm:grid-cols-2 md:grid-cols-3 lg:grid-cols-4 gap-4">
                  <LoanTextField
                    id="FirstName"
                    label="FirstName"
                    value={soleDependent.FirstName}
                    onChange={handleInputChangeSoleDependent}
                    name="FirstName"
                  />
                  <LoanTextField
                    id="MiddleName"
                    label="MiddleName"
                    value={soleDependent.MiddleName}
                    onChange={handleInputChangeSoleDependent}
                    name="MiddleName"
                  />
                  <LoanTextField
                    id="LastName"
                    label="LastName"
                    value={soleDependent.LastName}
                    onChange={handleInputChangeSoleDependent}
                    name="LastName"
                  />
                  <FormControl variant="standard" sx={{ minWidth: 120 }}>
                    <InputLabel id="countrylbl" color="secondary">
                      {" "}
                      Nationality{" "}
                    </InputLabel>
                    <Select
                      color="secondary"
                      onChange={(event) =>
                        (soleDependent.NationalityId = event.target.value)
                      }
                      labelId="countrylbl"
                      id="countrySelect"
                      label="Country"
                    >
                      <MenuItem value="">
                        <em>None</em>
                      </MenuItem>
                      {country.map((yourCounty) => (
                        <MenuItem
                          key={yourCounty.Id}
                          NationalityID={yourCounty.Id}
                          value={yourCounty.Id}
                        >
                          {yourCounty.Name}
                        </MenuItem>
                      ))}
                    </Select>
                  </FormControl>
                  <FormControl variant="standard" sx={{ minWidth: 120 }}>
                    <InputLabel id="countrylbl" color="secondary">
                      {" "}
                      Country Of Origin{" "}
                    </InputLabel>
                    <Select
                      color="secondary"
                      onChange={(event) =>
                        (soleDependent.CountryOfOriginId = event.target.value)
                      }
                      labelId="countrylbl"
                      id="countrySelect"
                      label="Country"
                    >
                      <MenuItem value="">
                        <em>None</em>
                      </MenuItem>
                      {country.map((yourCounty) => (
                        <MenuItem
                          key={yourCounty.Id}
                          NationalityID={yourCounty.Id}
                          value={yourCounty.Id}
                        >
                          {yourCounty.Name}
                        </MenuItem>
                      ))}
                    </Select>
                  </FormControl>
                  <FormControl variant="standard" sx={{ minWidth: 120 }}>
                    <InputLabel id="countrylbl" color="secondary">
                      {" "}
                      Country Of Residence{" "}
                    </InputLabel>
                    <Select
                      color="secondary"
                      onChange={(event) =>
                        (soleDependent.CountryOfResidenceId =
                          event.target.value)
                      }
                      labelId="countrylbl"
                      id="countrySelect"
                      label="Country"
                    >
                      <MenuItem value="">
                        <em>None</em>
                      </MenuItem>
                      {country.map((yourCounty) => (
                        <MenuItem
                          key={yourCounty.Id}
                          NationalityID={yourCounty.Id}
                          value={yourCounty.Id}
                        >
                          {yourCounty.Name}
                        </MenuItem>
                      ))}
                    </Select>
                  </FormControl>
                  <FormControl variant="standard" sx={{ minWidth: 120 }}>
                    <InputLabel id="countrylbl" color="secondary">
                      {" "}
                      Proof Of Identity Type{" "}
                    </InputLabel>
                    <Select
                      color="secondary"
                      onChange={(event) =>
                        (soleDependent.ProofOfIdentityTypeId =
                          event.target.value)
                      }
                      labelId="countrylbl"
                      id="countrySelect"
                      label="Country"
                    >
                      <MenuItem value="">
                        <em>None</em>
                      </MenuItem>
                      {proofOfIdentityType.map((yourProofOfIdentityType) => (
                        <MenuItem
                          key={yourProofOfIdentityType.Id}
                          ProofOfIdentityTypeId={yourProofOfIdentityType.Id}
                          value={yourProofOfIdentityType.Id}
                        >
                          {yourProofOfIdentityType.Name}
                        </MenuItem>
                      ))}
                    </Select>
                  </FormControl>
                  <div>
                  {currentFile && (
                    <div className="progress">
                      <div
                        className="progress-bar progress-bar-info progress-bar-striped"
                        role="progressbar"
                        aria-valuenow={progress}
                        aria-valuemin="0"
                        aria-valuemax="100"
                        style={{ width: progress + "%" }}
                      >
                        {progress}%
                      </div>
                    </div>
                  )}
                  <label className="btn btn-default">
                    <input type="file" onChange={selectFile} />
                  </label>
                  <button
                    className="btn btn-success"
                    disabled={!selectedFiles}
                    onClick={uploadProofOfIdentity}
                  >
                    Proof Of Identity File
                  </button>
                  <div className="alert alert-light" role="alert">
                    {message}
                  </div>
                </div>
                  <p>
                  Identity Issue Date:
                  <div>
                    <DatePicker
                      selected={identityIssueDate}
                      onChange={(identityIssueDate) => setIdentityIssueDate(identityIssueDate)}
                    />
                  </div>
                </p>
                <p>
                identityExpir Date:
                  <div>
                    <DatePicker
                      selected={identityExpirDate}                      
                      onChange={(identityExpirDate) => setIdentityExpirDate(identityExpirDate) }                   
                    />                   
                  </div>
                </p>
                 
                  <FormControl variant="standard" sx={{ minWidth: 120 }}>
                    <InputLabel id="countrylbl" color="secondary">
                      {" "}
                      Dependent Relationship Type{" "}
                    </InputLabel>
                    <Select
                      color="secondary"
                      onChange={(event) =>
                        (soleDependent.DependentRelationshipTypeId =
                          event.target.value)
                      }
                      labelId="countrylbl"
                      id="countrySelect"
                      label="Country"
                    >
                      <MenuItem value="">
                        <em>None</em>
                      </MenuItem>
                      {dependentRelationshipType.map(
                        (dependentRelationship) => (
                          <MenuItem
                            key={dependentRelationship.Id}
                            DependentRelationshipTypeId={
                              dependentRelationship.Id
                            }
                            value={dependentRelationship.Id}
                          >
                            {dependentRelationship.Name}
                          </MenuItem>
                        )
                      )}
                    </Select>
                  </FormControl>
                  <div>
                  {currentFile && (
                    <div className="progress">
                      <div
                        className="progress-bar progress-bar-info progress-bar-striped"
                        role="progressbar"
                        aria-valuenow={progress}
                        aria-valuemin="0"
                        aria-valuemax="100"
                        style={{ width: progress + "%" }}
                      >
                        {progress}%
                      </div>
                    </div>
                  )}
                  <label className="btn btn-default">
                    <input type="file" onChange={selectFile} />
                  </label>
                  <button
                    className="btn btn-success"
                    disabled={!selectedFiles}
                    onClick={uploadBirthCertificate}
                  >
                    Birth Certificate
                  </button>
                  <div className="alert alert-light" role="alert">
                    {message}
                  </div>
                </div>
                  {/* <LoanTextField
                    id="BirthCertificate"
                    label="BirthCertificate"
                    value={soleDependent.BirthCertificate}
                    onChange={handleInputChangeSoleDependent}
                    name="BirthCertificate"
                  /> */}
                  <LoanTextField
                    id="BirthCertificateIssuer"
                    label="BirthCertificateIssuer"
                    value={soleDependent.BirthCertificateIssuer}
                    onChange={handleInputChangeSoleDependent}
                    name="BirthCertificateIssuer"
                  />
                </div>
              )}
              <div>
                <button
                  className="bg-[purple] hover:bg-purple-700 text-white font-bold py-2 px-4 rounded focus:outline-none focus:shadow-outline"
                  onClick={() => {
                    saveSoleDependent();
                  }}
                >
                  save
                </button>
              </div>
            </div>
          )}
        </div>
      </CompanyModal>
      <CompanyModal
        isOpen={isCompanySoleDependentEditedModalOpen}
        onClose={handleCompanySoleDependentEditCloseModal}
        title="dependent edit information"
      >
        <div>
          <form onSubmit={updateDependent}>
            <div className="relative center justify-center flex-1 w-full max-w-full grid grid-cols-1 sm:grid-cols-2 md:grid-cols-3 lg:grid-cols-4 gap-4">
              <LoanTextField
                id="FirstName"
                label="FirstName"
                value={editSoleDependent.FirstName}
                onChange={handleInputChangeEditDependent}
                name="FirstName"
              />
              <LoanTextField
                id="MiddleName"
                label="MiddleName"
                value={editSoleDependent.MiddleName}
                onChange={handleInputChangeEditDependent}
                name="MiddleName"
              />
              <LoanTextField
                id="LastName"
                label="LastName"
                value={editSoleDependent.LastName}
                onChange={handleInputChangeEditDependent}
                name="LastName"
              />
              <FormControl variant="standard" sx={{ minWidth: 120 }}>
                <InputLabel id="countrylbl" color="secondary">
                  {" "}
                  Nationality{" "}
                </InputLabel>
                <Select
                  color="secondary"
                  onChange={(event) =>
                    (editSoleDependent.NationalityId = event.target.value)
                  }
                  labelId="countrylbl"
                  id="countrySelect"
                  label="Country"
                >
                  <MenuItem value="">
                    <em>None</em>
                  </MenuItem>
                  {country.map((yourCounty) => (
                    <MenuItem
                      key={yourCounty.Id}
                      NationalityID={yourCounty.Id}
                      value={yourCounty.Id}
                    >
                      {yourCounty.Name}
                    </MenuItem>
                  ))}
                </Select>
              </FormControl>
              <FormControl variant="standard" sx={{ minWidth: 120 }}>
                <InputLabel id="countrylbl" color="secondary">
                  {" "}
                  Country Of Origin{" "}
                </InputLabel>
                <Select
                  color="secondary"
                  onChange={(event) =>
                    (editSoleDependent.CountryOfOriginId = event.target.value)
                  }
                  labelId="countrylbl"
                  id="countrySelect"
                  label="Country"
                >
                  <MenuItem value="">
                    <em>None</em>
                  </MenuItem>
                  {country.map((yourCounty) => (
                    <MenuItem
                      key={yourCounty.Id}
                      NationalityID={yourCounty.Id}
                      value={yourCounty.Id}
                    >
                      {yourCounty.Name}
                    </MenuItem>
                  ))}
                </Select>
              </FormControl>
              <FormControl variant="standard" sx={{ minWidth: 120 }}>
                <InputLabel id="countrylbl" color="secondary">
                  {" "}
                  Country Of Residence{" "}
                </InputLabel>
                <Select
                  color="secondary"
                  onChange={(event) =>
                    (editSoleDependent.CountryOfResidenceId =
                      event.target.value)
                  }
                  labelId="countrylbl"
                  id="countrySelect"
                  label="Country"
                >
                  <MenuItem value="">
                    <em>None</em>
                  </MenuItem>
                  {country.map((yourCounty) => (
                    <MenuItem
                      key={yourCounty.Id}
                      NationalityID={yourCounty.Id}
                      value={yourCounty.Id}
                    >
                      {yourCounty.Name}
                    </MenuItem>
                  ))}
                </Select>
              </FormControl>
              <FormControl variant="standard" sx={{ minWidth: 120 }}>
                <InputLabel id="countrylbl" color="secondary">
                  {" "}
                  Proof Of Identity Type{" "}
                </InputLabel>
                <Select
                  color="secondary"
                  onChange={(event) =>
                    (editSoleDependent.ProofOfIdentityTypeId =
                      event.target.value)
                  }
                  labelId="countrylbl"
                  id="countrySelect"
                  label="Country"
                >
                  <MenuItem value="">
                    <em>None</em>
                  </MenuItem>
                  {proofOfIdentityType.map((yourProofOfIdentityType) => (
                    <MenuItem
                      key={yourProofOfIdentityType.Id}
                      ProofOfIdentityTypeId={yourProofOfIdentityType.Id}
                      value={yourProofOfIdentityType.Id}
                    >
                      {yourProofOfIdentityType.Name}
                    </MenuItem>
                  ))}
                </Select>
              </FormControl>
              <LoanTextField
                id="ProofOfIdentityFile"
                label="ProofOfIdentityFile"
                value={editSoleDependent.ProofOfIdentityFile}
                onChange={handleInputChangeEditDependent}
                name="ProofOfIdentityFile"
              />
              <LoanTextField
                id="ProofOfIdentityIssueDate"
                label="ProofOfIdentityIssueDate"
                value={editSoleDependent.ProofOfIdentityIssueDate}
                onChange={handleInputChangeEditDependent}
                name="ProofOfIdentityIssueDate"
              />
              <LoanTextField
                id="ProofOfIdentityExpirDate"
                label="ProofOfIdentityExpirDate"
                value={editSoleDependent.ProofOfIdentityExpirDate}
                onChange={handleInputChangeEditDependent}
                name="ProofOfIdentityExpirDate"
              />
              <FormControl variant="standard" sx={{ minWidth: 120 }}>
                <InputLabel id="countrylbl" color="secondary">
                  {" "}
                  Dependent Relationship Type{" "}
                </InputLabel>
                <Select
                  color="secondary"
                  onChange={(event) =>
                    (editSoleDependent.DependentRelationshipTypeId =
                      event.target.value)
                  }
                  labelId="countrylbl"
                  id="countrySelect"
                  label="Country"
                >
                  <MenuItem value="">
                    <em>None</em>
                  </MenuItem>
                  {dependentRelationshipType.map((dependentRelationship) => (
                    <MenuItem
                      key={dependentRelationship.Id}
                      DependentRelationshipTypeId={dependentRelationship.Id}
                      value={dependentRelationship.Id}
                    >
                      {dependentRelationship.Name}
                    </MenuItem>
                  ))}
                </Select>
              </FormControl>
              <LoanTextField
                id="BirthCertificate"
                label="BirthCertificate"
                value={editSoleDependent.BirthCertificate}
                onChange={handleInputChangeEditDependent}
                name="BirthCertificate"
              />
              <LoanTextField
                id="BirthCertificateIssuer"
                label="BirthCertificateIssuer"
                value={editSoleDependent.BirthCertificateIssuer}
                onChange={handleInputChangeEditDependent}
                name="BirthCertificateIssuer"
              />
            </div>
            <div>
              <button className="bg-[purple] hover:bg-purple-700 text-white font-bold py-2 px-4 rounded focus:outline-none focus:shadow-outline">
                Update
              </button>
            </div>
          </form>
        </div>
      </CompanyModal>
    </div>
  );
};
export default ViewSoleDependent;
